CREATE TABLE m_navi_voice(
  id INTEGER NOT NULL,
  member_m_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  navi_voice_release_route INTEGER NOT NULL,
  navi_voice_release_value INTEGER NOT NULL,
  display_order INTEGER NOT NULL,
  list_type INTEGER NOT NULL,
  PRIMARY KEY (id),
  FOREIGN KEY (id) REFERENCES m_navi_timeline(id),
  FOREIGN KEY (member_m_id) REFERENCES m_member(id)
);
